import React from 'react';
import './Skills.css';

const Skills = () => {
  const skillCategories = [
    {
      title: "Programming Languages",
      skills: [
        { name: "JavaScript", level: 95 },
        { name: "C++", level: 85 },
        { name: "Python", level: 80 },
        { name: "Java", level: 75 },
        { name: "C", level: 70 },
        { name: "HTML/CSS", level: 90 }
      ]
    },
    {
      title: "Databases",
      skills: [
        { name: "MongoDB", level: 85 },
        { name: "PostgreSQL", level: 75 },
        { name: "Neo4j", level: 65 },
        { name: "Oracle", level: 60 },
        { name: "Neon", level: 80 }
      ]
    },
    {
      title: "Frameworks & Libraries",
      skills: [
        { name: "React", level: 90 },
        { name: "Node.js", level: 85 },
        { name: "Express.js", level: 85 },
        { name: "Next.js", level: 80 },
        { name: ".NET", level: 70 }
      ]
    },
    {
      title: "Cloud Platforms",
      skills: [
        { name: "AWS", level: 75 },
        { name: "Microsoft Azure", level: 70 },
        { name: "Vercel", level: 85 },
        { name: "Render", level: 80 }
      ]
    },
    {
      title: "Development Tools",
      skills: [
        { name: "GitHub", level: 95 },
        { name: "Postman", level: 85 },
        { name: "JUnit", level: 75 }
      ]
    },
    {
      title: "Core Web3.0",
      skills: [
        { name: "Smart Contract Development", level: 75 },
        { name: "Blockchain Transactions", level: 70 },
        { name: "DApp Management", level: 65 }
      ]
    },
    {
      title: "Data Science",
      skills: [
        { name: "Python", level: 80 },
        { name: "Jupyter Notebook", level: 75 }
      ]
    },
    {
      title: "Software Development",
      skills: [
        { name: "OOP", level: 90 },
        { name: "Data Structures & Algorithms", level: 85 },
        { name: "Software Architecture", level: 80 },
        { name: "Testing", level: 85 },
        { name: "Design Patterns", level: 75 },
        { name: "Web & Mobile Development", level: 90 }
      ]
    }
  ];

  return (
    <section id="skills" className="skills section">
      <div className="container">
        <h2 className="section-title">Skills & Technologies</h2>
        <div className="skills-grid">
          {skillCategories.map((category, index) => (
            <div key={index} className="skill-category">
              <h3 className="category-title">{category.title}</h3>
              <div className="skills-list">
                {category.skills.map((skill, skillIndex) => (
                  <div key={skillIndex} className="skill-item">
                    <div className="skill-header">
                      <span className="skill-name">{skill.name}</span>
                      <span className="skill-percentage">{skill.level}%</span>
                    </div>
                    <div className="skill-bar">
                      <div 
                        className="skill-progress" 
                        style={{ width: `${skill.level}%` }}
                      ></div>
                    </div>
                  </div>
                ))}
              </div>
            </div>
          ))}
        </div>
      </div>
    </section>
  );
};

export default Skills;
